INSERT INTO `tb_highlight` (`HIGH_ID`, `HIGH_TITLE`, `HIGH_TITLE_ZH`, `HIGH_SHORTDESC`, `HIGH_SHORTDESC_ZH`, `HIGH_STARTDATE`, `HIGH_ENDDATE`, `HIGH_IMAGE`, `HIGH_ORDER`, `HIGH_SHOWTOP`, `HIGH_VISIBLE`, `HIGH_ALLOWCOMMENT`, `HIGH_DESC`, `HIGH_DESC_ZH`, `HIGH_ACTIVE`, `HIGH_CREATEDBY`, `HIGH_CREATION`, `HIGH_UPDATEDBY`, `HIGH_LASTUPDATE`, `HIGH_TITLE_JP`, `HIGH_TITLE_MS`, `HIGH_SHORTDESC_JP`, `HIGH_SHORTDESC_MS`, `HIGH_DESC_JP`, `HIGH_DESC_MS`) VALUES
(1, 'Facebook Contest', '', 'The Facebook contest was special design to celebrate the Chinese New year. It is Oren Sport very first Facebook contest and we believe that we will have more similar contest will be coming soon. Congratulation to these two lucky person Fannie Lee and Elaine Tan has won our facebook contest prizes.', '', '2014-02-14 12:00:00', '2014-02-14 12:00:00', '1399449433_20140213_172409-s.jpg', 0, 1, 1, 1, '<p style="text-align:justify;">\r\n	The Facebook contest was special design to celebrate the Chinese New year. It is Oren Sport very first Facebook contest and we believe that we will have more similar contest will be coming soon. Congratulation to these two lucky person Fannie Lee and Elaine Tan has won our facebook contest prizes.</p>', NULL, 1, 1, '2014-04-23 17:49:43', 1, '2014-05-07 16:32:41', '', '', '', '', NULL, NULL),
(2, 'Masquerade Night', '', 'Oren Sport was held 18th Annual Dinner in Danga Bay Convention centre. The theme (Masquerade Night) was the special highlight for this event and lots of activities make this event happening.', '', '2014-01-25 12:00:00', '2014-01-25 12:00:00', '1399448618_img_4775_1280x853-s.jpg', 0, 1, 1, 1, '<p style="text-align:justify;">\r\n	Oren Sport was held 18th Annual Dinner in Danga Bay Convention centre. The theme (Masquerade Night) was the special highlight for this event and lots of activities make this event happening.</p>', NULL, 1, 1, '2014-04-24 10:52:49', 1, '2014-05-07 16:33:55', '', '', '', '', NULL, NULL),
(3, 'Lion Dance in Oren Sport', '', 'An amazing lion dance &amp; firework in Oren Sport, it is common sight during Chinese new year, we believe that the lion dance will bring along good fortune to our business.', '', '2014-02-11 12:00:00', '2014-02-11 12:00:00', '1403599496_20140211_115059-ss.jpg', 0, 1, 1, 1, '<p style="text-align:justify;">\r\n	An amazing lion dance &amp; firework in Oren Sport, it is common sight during Chinese new year, we believe that the lion dance will bring along good fortune to our business.</p>', NULL, 1, 1, '2014-04-24 10:55:44', 1, '2014-06-24 16:44:56', '', '', '', '', NULL, NULL);
