(6, 'Contact Us', 'Contact Us', 'Contact Us', '<div>\r\n					<h1>\r\n						Contact Us</h1>\r\n				</div>', 1, 1, 1, 0, 1, 1, 1, '', 6, 'en', 'contactus.aspx', 0, 4, '', 1, '', 1, 0, '', '', 1, 'contactusmb.aspx', '', 1, 0, 1, '2014-04-16 11:16:46', 1, '2014-06-23 16:50:25', '', 0),
(7, 'Agent Login', 'Agent Login', 'Agent Login', '', 1, 0, 0, 0, 1, 1, 1, '', 6, 'en', 'agentlogin.aspx', 1, 0, '', 1, '', 1, 0, '', '', 0, NULL, NULL, 1, 0, 1, '2014-04-21 10:59:52', 1, '2014-04-21 11:01:09', '', 0),
(8, 'Company Overview', 'Company Overview', 'Company Overview', '<h1>\r\n	Oren Sport Profile</h1>\r\n<table border="0" cellpadding="0" cellspacing="0" style="width: 100%;padding-top:0px;">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:justify;padding-bottom:20px;">\r\n				Since its founding in 1995, Oren Sport has become a leading supplier of quality corporate apparel, including t-shirts, shirts, windbreakers, jackets, workwear, caps and towels. Oren Sport is the core brand for the company and all products are selling under the brand. The Oren Sport concept is to create basic, fashionable apparels to suit a contemporary lifestyle. The quality fabrics, including 100% cotton, quick dry (moisture wicking fabric), single/double jersey, horizon cotton and honeycomb used in Oren Sport apparels fit well and create excellence silhouette.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:justify;padding-bottom:20px;">\r\n				Oren Sport is also provide customers with silkscreen printing, embroidery, heat press services support to enable its customers to enjoy one-stop services and value. The company distributes its products in corporate apparel markets in the Southeast Asia countries particularly in Malaysia &amp; Singapore, where Oren Sport is the industry leading brand. The company continues to grow in new and existing markets with a focus on quality, sustainability and profitability. Oren Sport&rsquo;s further expansion for the Group is to penetrate the international corporate apparel market.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:justify;padding-bottom:20px;">\r\n				Today Oren Sport is an established company, with over 350 of Oren Sport colleagues who serve many thousands of customers. The company dedicated employees provide superior delivery standards that lead to higher customer satisfaction and loyalty. Oren Sport is committed to employee welfare practice as the company success is more than ever dependent on its employees.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, 1, 1, 0, 1, 1, 1, '', 1, 'en', 'pagesub.aspx', 1, 3, '', 1, '', 1, 0, '', '', 1, 'pagesubmb.aspx', '<p style="text-align:justify;">\r\n	Since its founding in 1995, Oren Sport has become a leading supplier of quality corporate apparel, including t-shirts, shirts, windbreakers, jackets, workwear, caps and towels. Oren Sport is the core brand for the company and all products are selling under the brand. The Oren Sport concept is to create basic, fashionable apparels to suit a contemporary lifestyle. The quality fabrics, including 100% cotton, quick dry (moisture wicking fabric), single/double jersey, horizon cotton and honeycomb used in Oren Sport apparels fit well and create excellence silhouette.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style="text-align:justify;">\r\n	Oren Sport is also provide customers with silkscreen printing, embroidery, heat press services support to enable its customers to enjoy one-stop services and value. The company distributes its products in corporate apparel markets in the Southeast Asia countries particularly in Malaysia &amp; Singapore, where Oren Sport is the industry leading brand. The company continues to grow in new and existing markets with a focus on quality, sustainability and profitability. Oren Sport&rsquo;s further expansion for the Group is to penetrate the international corporate apparel market.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style="text-align:justify;">\r\n	Today Oren Sport is an established company, with over 350 of Oren Sport colleagues who serve many thousands of customers. The company dedicated employees provide superior delivery standards that lead to higher customer satisfaction and loyalty. Oren Sport is committed to employee welfare practice as the company success is more than ever dependent on its employees.</p>', 1, 0, 1, '2014-04-23 14:24:29', 1, '2014-06-24 17:22:17', '', 0),
(9, 'Company Mission & Vision', 'Company Mission & Vision', 'Company Mission & Vision', '<h1>\r\n	Company Mission And Vision</h1>\r\n<table border="0" cellpadding="0" cellspacing="0" style="width: 100%;padding-top:0px;">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:justify;padding-bottom:20px;">\r\n				To continuously provide basic, fashionable, high quality corporate apparel at the best prices in the market. We aspire to make everyone feel good and look great with our collections that are wide-ranging and varied for lifestyle in work and casual. We want each company to have its own unique corporate identity within our brand niches.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:justify;padding-bottom:20px;">\r\n				In order to achieve this, we will source from global manufacturers and secure mass-volume orders at lower cost. We will always offer customer with unbeatable value for money in our design, quality and sustainability. It is our aim to always exceed our customers&rsquo; expectations on our products and services.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:justify;padding-bottom:20px;">\r\n				As a result, we want to make Oren Sport become a global corporate apparel company targeting high growth for our exceptional quality products and services.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, 1, 0, 0, 1, 1, 1, '', 2, 'en', 'pagesub.aspx', 1, 3, '', 1, '', 1, 0, '', '', 1, 'pagesubmb.aspx', '<p style="text-align:justify;">\r\n	To continuously provide basic, fashionable, high quality corporate apparel at the best prices in the market. We aspire to make everyone feel good and look great with our collections that are wide-ranging and varied for lifestyle in work and casual. We want each company to have its own unique corporate identity within our brand niches.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style="text-align:justify;">\r\n	In order to achieve this, we will source from global manufacturers and secure mass-volume orders at lower cost. We will always offer customer with unbeatable value for money in our design, quality and sustainability. It is our aim to always exceed our customers&rsquo; expectations on our products and services.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style="text-align:justify;">\r\n	As a result, we want to make Oren Sport become a global corporate apparel company targeting high growth for our exceptional quality products and services.</p>', 1, 0, 1, '2014-04-23 17:47:58', 1, '2014-06-24 17:22:46', '', 0),
(10, 'Join Oren Sport Team', 'Join Oren Sport Team', 'Join Oren Sport Team', '<style type="text/css">\r\na.hypAnchor {font-size:20px; font-family:Roboto; color:#434343;}\r\na.hypAnchor:link {text-decoration:none;}\r\na.hypAnchor:visited {text-decoration:none;}\r\na.hypAnchor:hover {text-decoration:none; color:#ff8e1a;}\r\na.hypAnchor:active {text-decoration:none; color:#ff8e1a;}</style>\r\n<table border="0" cellpadding="0" cellspacing="0" style="width: 100%;">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<h1>\r\n					Join Oren Sport Team</h1>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:justify;">\r\n				Oren Sport is committed to teamwork, value openness and personal initiatives as part of the company culture. As one of the leading corporate apparel providers, Oren Sport offers excellent benefits and endless career opportunities to committed, motivated individuals who share our values and can contribute to our success.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:30px">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h2>\r\n					Open Positions</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:justify;">\r\n				We are now accepting applications for the following positions in our Group of Companies:</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:40px">\r\n				&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table border="0" cellpadding="0" cellspacing="0" style="width: 100%; ">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width: 50%; text-align: center;">\r\n				<a name="FinanceManager"></a><a class="hypAnchor" href="#FinanceManager">Finance Manager</a></td>\r\n			<td style="text-align: center;">\r\n				<a class="hypAnchor" href="#SalesExecutive">Sales Executive</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:5px">\r\n				<img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></td>\r\n			<td style="height:5px">\r\n				<img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width: 50%; text-align: center;">\r\n				<a class="hypAnchor" href="#PurchasingOfficer">Purchasing Officer</a></td>\r\n			<td style="text-align: center;">\r\n				<a class="hypAnchor" href="#AccountAssistant">Account Assistant</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:5px">\r\n				<img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></td>\r\n			<td style="height:5px">\r\n				<img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height: 40px;">\r\n				&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table border="0" cellpadding="0" cellspacing="0" style="width: 100%;">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Finance Manager</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="color:#603813; padding-bottom:10px;">\r\n				Responsibilities:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ol class="olContent">\r\n					<li>\r\n						Responsible in full spectrum of Finance &amp; Account management to support business growth and operational needs</li>\r\n					<li>\r\n						To review, monitor &amp; ensure the proper &amp; accurate and up-to-date accounting records</li>\r\n					<li>\r\n						Review the Group&rsquo;s structure to ensure effective cash flow planning &amp; tax efficiency</li>\r\n					<li>\r\n						To advise board of directors on all financial matters with analysis</li>\r\n					<li>\r\n						Liaise with bankers, external auditors and other regulatory bodies</li>\r\n					<li>\r\n						Other ad-hoc special projects</li>\r\n				</ol>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height="10">\r\n				<img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="color:#603813; padding-bottom:10px;">\r\n				Requirements:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul class="ulContent">\r\n					<li>\r\n						Chartered Accountant possesses professional accountancy qualification of ACCA/CIMA or equivalent</li>\r\n					<li>\r\n						Minimum 5 years related working experience preferably in manufacturing field</li>\r\n					<li>\r\n						Good knowledge of computerized accounting systems</li>\r\n					<li>\r\n						Knowledge in consolidation account</li>\r\n					<li>\r\n						Able to manage a team of 25 persons effectively &amp; independently</li>\r\n					<li>\r\n						Flexible in time management</li>\r\n					<li>\r\n						Proficient in Chinese, English &amp; Malay</li>\r\n					<li>\r\n						Able to interact with all levels</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height: 20px;">\r\n				<a name="SalesExecutive"></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="border-top-width: 1px; border-top-style: solid; height: 30px;">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Sales Executive</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="color:#603813; padding-bottom:10px;">\r\n				Responsibilities:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ol class="olContent">\r\n					<li>\r\n						Looking for new customers to expand business portfolio</li>\r\n					<li>\r\n						Regular visit to customers and maintain good relationship with existing customers base</li>\r\n					<li>\r\n						Assist in business sales planning monthly target setting and strategic initiative planning to achieve sales target</li>\r\n				</ol>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height="10">\r\n				<img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="color:#603813; padding-bottom:10px;">\r\n				Requirements:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul class="ulContent">\r\n					<li>\r\n						Candidate must possesses at least diploma level equivalent or above</li>\r\n					<li>\r\n						Fresh graduates are welcomed to apply</li>\r\n					<li>\r\n						Required language(s) Chinese, English, Malay and some local Chinese dialects</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height="10">\r\n				<img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="color:#603813; padding-bottom:10px;">\r\n				We offer:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul class="ulContent">\r\n					<li>\r\n						Basic salary + Monthly commission + Travel allowance + petrol card</li>\r\n					<li>\r\n						On job and products training</li>\r\n					<li>\r\n						Career advancement opportunities</li>\r\n					<li>\r\n						Yearly performance travel oversea</li>\r\n					<li>\r\n						EPF + SOCSO</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height: 20px;">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="border-top-width: 1px; border-top-style: solid; height: 30px;">\r\n				<a name="PurchasingOfficer"></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Purchasing Officer</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="color:#603813; padding-bottom:10px;">\r\n				Responsibilities:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ol class="olContent">\r\n					<li>\r\n						Issue PO to supplier &amp; follow up with supplier to ensure prompt delivery of goods</li>\r\n					<li>\r\n						Initiate and maintain effective and professional relationship with existing and potential vendor/suppliers</li>\r\n					<li>\r\n						Study the relevant product lines, with a steady focus on enhancing product knowledge. Seek out new/alternative brands that will help increase the company&rsquo;s profitability</li>\r\n					<li>\r\n						Record all related Singapore tender transaction</li>\r\n					<li>\r\n						Monitor tender opportunity everyday &amp; bid the tender</li>\r\n					<li>\r\n						Communication with sales person for appointment or sample delivery</li>\r\n					<li>\r\n						Monthly purchasing &amp; sales trend report</li>\r\n				</ol>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height="10">\r\n				<img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="color:#603813; padding-bottom:10px;">\r\n				Requirements:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul class="ulContent">\r\n					<li>\r\n						Candidate must possess at least diploma in business studies / management or equivalent</li>\r\n					<li>\r\n						Fresh graduate are welcomed to apply</li>\r\n					<li>\r\n						Preferably junior executive specializing in purchasing / inventory/ material &amp; warehouse management or equivalent</li>\r\n					<li>\r\n						Language proficiency: English, mandarin</li>\r\n					<li>\r\n						Must be able to converse in mandarin as the position requires candidate to deal and communicate with suppliers in China</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height: 20px;">\r\n				<a name="AccountAssistant"></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="border-top-width: 1px; border-top-style: solid; height: 30px;">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Account Assistant</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="color:#603813; padding-bottom:10px;">\r\n				Responsibilities:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ol class="olContent">\r\n					<li>\r\n						Responsible for daily general accounting such as AR/AP, cheque issuing etc</li>\r\n					<li>\r\n						To ensure accounting documentation are filed and properly maintained</li>\r\n					<li>\r\n						Familiar with ERP accounting system will be added advantages</li>\r\n					<li>\r\n						Generate and filing of administrative documents</li>\r\n					<li>\r\n						Other ad-hoc tasks as assigned by superior/management from time to time</li>\r\n				</ol>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height="10">\r\n				<img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="color:#603813; padding-bottom:10px;">\r\n				Requirements:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul class="ulContent">\r\n					<li>\r\n						Candidate must possess at least a SPM, Diploma, Advanced/Higher/Graduate Diploma, Finance / Accountancy / Banking or equivalent.</li>\r\n					<li>\r\n						Required language(s): Chinese, English</li>\r\n					<li>\r\n						Fresh graduate or 1 year(s) of working experience in account field is required for this position</li>\r\n					<li>\r\n						Full time position available</li>\r\n					<li>\r\n						Computer literate with good knowledge of accounting software application</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table border="0" cellpadding="0" cellspacing="0" style="width: 100%;">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				If you are interested in applying for one of the above positions, kindly send your detailed resume, stating present and expected salaries, contact numbers and recent passport-sized photograph to <a class="hypEmail" href="mailto:talent@orensport.com">talent@orensport.com</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td height="10">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				* Only shortlisted candidates will be notified.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, 1, 0, 0, 1, 1, 1, '', 3, 'en', 'pagesub.aspx', 1, 3, '', 1, '', 1, 0, '', '', 1, 'pagesubmb.aspx', '<table border="0" cellpadding="0" cellspacing="0" style="text-align:justify;">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				Oren Sport is committed to teamwork, value openness and personal initiatives as part of the company culture. As one of the leading corporate apparel providers, Oren Sport offers excellent benefits and endless career opportunities to committed, motivated individuals who share our values and can contribute to our success.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h2>\r\n					Open Position</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				We are now accepting applications for the following positions in our Group of Comp