r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Responsibilities:</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ol class="olContent">\r\n					<li>\r\n						Looking for new customers to expand business portfolio</li>\r\n					<li>\r\n						Regular visit to customers and maintain good relationship with existing customers base</li>\r\n					<li>\r\n						Assist in business sales planning monthly target setting and strategic initiative planning to achieve sales target</li>\r\n				</ol>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Requirements:</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul class="ulContent">\r\n					<li>\r\n						Candidate must possesses at least diploma level equivalent or above</li>\r\n					<li>\r\n						Fresh graduates are welcomed to apply</li>\r\n					<li>\r\n						Required language(s) Chinese, English, Malay and some local Chinese dialects</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					We offer:</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul class="ulContent">\r\n					<li>\r\n						Basic salary + Monthly commission + Travel allowance + petrol card</li>\r\n					<li>\r\n						On job and products training</li>\r\n					<li>\r\n						Career advancement opportunities</li>\r\n					<li>\r\n						Yearly performance travel oversea</li>\r\n					<li>\r\n						EPF + SOCSO</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<hr />\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h2>\r\n					Purchasing Officer</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Responsibilities:</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ol class="olContent">\r\n					<li>\r\n						Issue PO to supplier &amp; follow up with supplier to ensure prompt delivery of goods</li>\r\n					<li>\r\n						Initiate and maintain effective and professional relationship with existing and potential vendor/suppliers</li>\r\n					<li>\r\n						Study the relevant product lines, with a steady focus on enhancing product knowledge. Seek out new/alternative brands that will help increase the company&rsquo;s profitability</li>\r\n					<li>\r\n						Record all related Singapore tender transaction</li>\r\n					<li>\r\n						Monitor tender opportunity everyday &amp; bid the tender</li>\r\n					<li>\r\n						Communication with sales person for appointment or sample delivery</li>\r\n					<li>\r\n						Monthly purchasing &amp; sales trend report</li>\r\n				</ol>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Requirements:</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul class="ulContent">\r\n					<li>\r\n						Candidate must possess at least diploma in business studies/management or equivalent</li>\r\n					<li>\r\n						Fresh graduate are welcomed to apply</li>\r\n					<li>\r\n						Preferably junior executive specializing in purchasing/inventory/material &amp; warehouse management or equivalent</li>\r\n					<li>\r\n						Language proficiency: English, mandarin</li>\r\n					<li>\r\n						Must be able to converse in mandarin as the position requires candidate to deal and communicate with suppliers in China</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<hr />\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h2>\r\n					Account Assistant</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Responsibilities:</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ol class="olContent">\r\n					<li>\r\n						Responsible for daily general accounting such as AR/AP, cheque issuing etc</li>\r\n					<li>\r\n						To ensure accounting documentation are filed and properly maintained</li>\r\n					<li>\r\n						Familiar with ERP accounting system will be added advantages</li>\r\n					<li>\r\n						Generate and filing of administrative documents</li>\r\n					<li>\r\n						Other ad-hoc tasks as assigned by superior/management from time to time</li>\r\n				</ol>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h3>\r\n					Requirements:</h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul class="ulContent">\r\n					<li>\r\n						Candidate must possess at least a SPM, Diploma, Advanced/Higher/Graduate Diploma, Finance/Accountancy/Banking or equivalent</li>\r\n					<li>\r\n						Required language(s): Chinese, English</li>\r\n					<li>\r\n						Fresh graduate or 1 year(s) of working experience in account field is required for this position</li>\r\n					<li>\r\n						Full time position available</li>\r\n					<li>\r\n						Computer literate with good knowledge of accounting software application</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				If you are interested in applying for one of the above positions, kindly send your detailed resume, stating present and expected salaries, contact numbers and recent passport-sized photograph to talent@orensport.com</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				* Only shortlisted candidates will be notified.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, 0, 1, '2014-04-23 18:23:50', 1, '2014-06-25 17:41:07', '', 0),
(11, 'Catalogue Download', 'Catalogue Download', 'Catalogue Download', '<style type="text/css">\r\na.hypHereDownload {font-size:14px; color:#ff8e1a; text-decoration:none;}</style>\r\n<table border="0" cellpadding="0" cellspacing="0" style="width: 100%;">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<h1>\r\n					Catalogue Download</h1>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<h2>\r\n					Oren Sport Catalogue Vol.12 (2013-2014 SERIES)</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				Have our latest catalogue with you now!</td>\r\n		</tr>\r\n		<tr>\r\n			<td height="10">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				Click <a class="hypHereDownload" href="/data/cms/files/Oren Sport Catalogue Vol_12.pdf?iframe" rel="lightbox[Catalogue]">HERE</a> for Full Download.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, 1, 0, 0, 1, 1, 1, '', 8, 'en', 'pagesub.aspx', 1, 0, '', 1, '', 1, 0, '', '', 0, NULL, NULL, 1, 0, 1, '2014-04-24 11:09:57', 1, '2014-06-26 12:50:14', '', 0),
(12, 'Mobile Apps', 'Mobile Apps', 'Mobile Apps', '<style type="text/css">\r\na.btnDownloadMobileApps {display:block; width:380px; height:50px; background:url(/data/cms/images/btn-download-apps.gif) no-repeat;}\r\n\r\na.btnDownloadMobileApps:link {background:url(/data/cms/images/btn-download-apps.gif) no-repeat;}\r\na.btnDownloadMobileApps:visited {background:url(/data/cms/images/btn-download-apps.gif) no-repeat;}\r\na.btnDownloadMobileApps:hover {background:url(/data/cms/images/btn-download-apps.gif) no-repeat;}\r\na.btnDownloadMobileApps:active {background:url(/data/cms/images/btn-download-apps.gif) no-repeat;}\r\n\r\n.btnDownloadMobileApps span {background:url(/data/cms/images/btn-download-apps.gif) no-repeat 0px -100px; width:380px; height:50px; display:block; opacity: 0; -webkit-transition: opacity 1.5s; -moz-transition: opacity 1.5s; -o-transition: opacity 1.5s; transition: opacity 1.5s;}\r\n.btnDownloadMobileApps:hover span {opacity:1;}</style>\r\n<table border="0" cellpadding="0" cellspacing="0" style="width: 100%; text-align:justify;">\r\n	<tbody>\r\n		<tr>\r\n			<td valign="top">\r\n				<table border="0" cellpadding="0" cellspacing="0" style="width: 435px;">\r\n					<tbody>\r\n						<tr>\r\n							<td style="text-transform:uppercase;">\r\n								<h1>\r\n									Mobile Apps</h1>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td>\r\n								Now it&rsquo;s easier than ever to get Oren Sport catalogue with the Oren Sport Mobile app, you can bring E-catalogue anywhere to see your client. It&rsquo;s convenient and portable to you.</td>\r\n						</tr>\r\n						<tr>\r\n							<td>\r\n								&nbsp;</td>\r\n						</tr>\r\n						<tr>\r\n							<td>\r\n								Oren Sport Mobile app is now available through Apple &amp; Android users. You also can scan the below QR code to download Oren Sport Mobile App.</td>\r\n						</tr>\r\n						<tr>\r\n							<td height="40">\r\n								&nbsp;</td>\r\n						</tr>\r\n						<tr>\r\n							<td>\r\n								<a class="btnDownloadMobileApps" href="#"><span><img alt="" src="/img/cmn/trans.gif" style="width: 1px; height: 1px;" /></span></a></td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n			<td width="30">\r\n				&nbsp;</td>\r\n			<td>\r\n				<img alt="" src="/data/cms/images/img-content-mobile.jpg" style="width: 435px; height: 427px;" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, 1, 0, 0, 1, 1, 1, '', 1, 'en', 'pagesub2.aspx', 1, 4, '', 1, '', 1, 0, '', '', 0, NULL, NULL, 1, 0, 1, '2014-04-24 11:18:51', 1, '2014-06-25 16:56:18', '', 0),
